import {
    Box,
    Container,
    Image,
    Button,
    Flex
} from "@chakra-ui/react";
import logo from "../common/logo.svg";

const Header = () => {
    return (
        <Box as="header">
            <Container maxW="container.lg" >
                <Flex>
                    <div>
                        <div className={styles.burger}></div>
                        <div className={styles.burger}></div>
                        <div className={styles.burger}></div>
                    </div>

                    <Image src={logo} />

                    <Button>Sign up</Button>
                </Flex>
            </Container>
        </Box>
    )
}

export default Header;
